var currentDate = new Date();
var isoDate = currentDate.toISOString();


const monthNames = [
  "January", "February", "March", "April", "May", "June",
  "July", "August", "September", "October", "November", "December"
];


const currentMonth = currentDate.getMonth();
let previousMonth;

if (currentMonth === 0) {
  // If current month is January, set previous month to December (index 11)
  previousMonth = 11;
} else {
  // For other months, subtract 1 from current month
  previousMonth = currentMonth - 1;
}

const lastMonthName = monthNames[previousMonth];
const currentMonthName = monthNames[currentMonth];

const currentYear = currentDate.getFullYear();
//const yearText = currentYear.toString();
const day = currentDate.getDate();

currentDate.setMonth(currentDate.getMonth() - 1);
const lastYear = currentDate.getFullYear();

const formattedTodayDate = `${day} ${currentMonthName} ${currentYear}`;
const formattedLastMonthDate = `${lastMonthName}${lastYear}`;


var data = {
  "ImportDate": isoDate,
  "OneDriveFileLocation": "root:/Voice/HN-000006568.csv"
};

return data

